import posts from '../posts.json'
import Link from 'next/link'
import Head from 'next/head'

export default () => (
	<div>
		<h1>Blog</h1>
		<ul>
			{
				Object.entries(posts).map((value, index) => (
					<li key={index}>
						<Link href="/blog/[id]" as={'blog/' + value[0]}>
							<a>{value[1].title}</a>
						</Link>
					</li>
				))
			}
		</ul>
	</div>
)

